import React from 'react';

const CardFormScreen = (props) => {
    return (
        <div className="card-form">
            <label for={props.for}>{props.label}</label>
            <div className="label-description">
                <p>{props.children}</p>
            </div>
        </div>
    );
}

export default CardFormScreen;
